import {useState} from 'react'
import './SearchComponent.css'

const SearchComponent = ({onClickSearch}) => {

    const [search, setSearch] = useState('');
    const [showError, setShowError] = useState(false);

    const HandleSubmit = (e) => {
        e.preventDefault();
        onClickSearch(search);
    }

    return (
        <div>
            <form onSubmit={HandleSubmit}>
                <div className="d-flex justify-content-center h-100">
                    <div className="searchbar">
                        <input className="search_input" type="text" value={search} onChange={(e) => setSearch(e.target.value)} placeholder="Search..." />
                        <alert className='alert alert-danger'>Error</alert>
                        <button type='submit' className='search_icon'><i className="fas fa-search"></i></button>
                    </div>
                </div>
            </form>

        </div>
    )
}

export default SearchComponent
